import React, { Component } from 'react'
import Grid from '@material-ui/core/Grid'

export class home extends Component {
    render() {
        return (
            <Grid container>
                <Grid item sm={8} xs={12}>
                    <p>
                        Content
                    </p>
                </Grid>
            </Grid>
        )
    }
}

export default home
